import React, {Component} from 'react';
import {Button, Space} from "antd";
import {PhoneOutlined,UsergroupAddOutlined} from '@ant-design/icons';
import footerStyle from './index.module.css'

class Footer extends Component {
    render() {
        return (
            <div className={footerStyle.footer}>
                <Space size={20}>
                    <Button className={footerStyle.btu} type='link' icon={<PhoneOutlined/>}>联系我们</Button>
                    <span>|</span>
                    <Button className={footerStyle.btu} type='link' icon={<UsergroupAddOutlined/>}>商务合作</Button>
                    <span>|</span>
                    <Button className={footerStyle.btu} type='link' icon={<PhoneOutlined/>}>在线客服</Button>
                    <span>|</span>
                    <Button className={footerStyle.btu} type='link' icon={<AuditOutlined />}>法律声明</Button>
                    <span>|</span>
                    <Button className={footerStyle.btu} type='link' icon={<PhoneOutlined/>}>投资关系</Button>
                    <span>|</span>
                    <Button className={footerStyle.btu} type='link' icon={<PhoneOutlined/>}>投诉建议</Button>
                </Space>
            </div>
        );
    }
}

export default Footer;
